commits.content:
* {
    margin: 0;
    padding: 0;
}

body {
    font-family: 'Lato', sans-serif;
    background-color: #212A3E
}

/* .background-image {
    object-fit: cover;
    height: 100%;
    width: 100%;

} */

a {
    text-decoration: none;
    color: #fff;
}
#title {
    background: url(images/night_sky.jpg);
    background-attachment: fixed;
    background-size: cover;
    background-position: center;
    background-repeat: no-repeat;
    text-align: center;
    height: 900px;
}



.nav > ul {
    display: flex;
    position: absolute;
    top: 30px;
    right: 0;
    color: #fff;
    list-style-type: none;
    gap: 30px;
    justify-content: flex-end;
    margin-right: 20px;
    font-size: 14px;
    font-weight: 400;
    bottom: 500px;
    text-transform: uppercase;
}

.nav ul li a {
    border-radius: 20px;
    padding: 6px 10px;
}

.nav ul li a:active,
.nav ul li a:hover {
    background: #fff;
    color: #2b1055;
}


.logo {
    position: absolute;
    top: 30px;
    left: 30px;
    color: #fff;
    font-size: 18px;
    font-weight: 500;
    text-transform: uppercase;
    text-decoration: none;
}

.intro {
    color: #fff;
    position: absolute;
    text-align: center;
    bottom: 320px;
    left: 520px;
    text-transform: uppercase;
    z-index: 1;
}



.intro > h1 {
    font-size: 60px;
    margin-bottom: 20px;
    font-weight: normal;
}

.about-page {
    display: flex;
    align-items: center;
    flex-direction: column;
}

.profile-img {
    height: 130px;
    width: 130px;
    margin-top: 100px;
}

.about-page > p {
    width: 500px;
    font-size: 16px;
    color: white;
    margin-top: 20px;
    line-height: 2;
    text-align: center;
}
.about-page > h2 {
    color: white;
    margin-top: 20px;
    text-align: center;
}
